import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";
import "./App.css";
import Login from "./pages/Login";

function App() {
  return (
    <>
      <Switch>
        <Route path="/login" component={Login} />
        <Route exact path="/">
          <Redirect to="/dashboard" />
        </Route>
      </Switch>
    </>
  );
}

export default App;
